import React, { useState, useEffect } from 'react';
import "../styles/Home.css";
import crackd1 from "../assets/crackd-homepage.png";
import crackd2 from "../assets/crackdmultihumor.png";
import crackd3 from "../assets/crackdLogoBlack.png";

const phrases = [
  'user interfaces',
  'user experiences',
  'website design',
];

function Typewriter({ words, speed = 150, pause = 2000 }) {
  const [displayedText, setDisplayedText] = useState('');
  const [wordIndex, setWordIndex] = useState(0);
  const [charIndex, setCharIndex] = useState(0);
  const [deleting, setDeleting] = useState(false);

  useEffect(() => {
    let timeout;
    const currentWord = words[wordIndex];

    if (!deleting) {
      if (charIndex < currentWord.length) {
        // Typing forward
        timeout = setTimeout(() => {
          setDisplayedText(currentWord.substring(0, charIndex + 1));
          setCharIndex(charIndex + 1);
        }, speed);
      } else {
        // Word fully typed, pause before deleting
        timeout = setTimeout(() => {
          setDeleting(true);
        }, pause);
      }
    } else {
      if (charIndex > 0) {
        // Deleting backward
        timeout = setTimeout(() => {
          setDisplayedText(currentWord.substring(0, charIndex - 1));
          setCharIndex(charIndex - 1);
        }, speed / 2);
      } else {
        // Finished deleting, move to next word
        timeout = setTimeout(() => {
          setDeleting(false);
          setWordIndex((wordIndex + 1) % words.length);
        }, 500);
      }
    }

    return () => clearTimeout(timeout);
  }, [charIndex, deleting, wordIndex, words, speed, pause]);

  return <span>{displayedText}</span>;
}

function Tagline() {
  return (
    <div>
      <h1 className="tagline">
        an interdisciplinary designer
        <br />
        focused on creating
        <br />
        <span className="typewriter-container">
        meaningful <Typewriter words={phrases} />
        </span>
      </h1>
    </div>
  );
}

function HumorProjectTextSection() {
  return (
    <div style={{ marginTop: "-12rem" }}>
      <h1 className="projectName">
      The Humor Project
      </h1>
      <h2 className="projectDescriptionHeader">
      second mini header describing the project
      </h2>
      <p className="projectDescription">
      description description description description
      description description description description
      description description description description
      description description description description
      </p>
    </div>
  );
}


function HumorProjectImagesSection() {
  return (
    <div style={{ marginTop: "2rem" }}>
      <h2>User-Interfaces & Web Design</h2>

      {/* Container for overlapping images */}
      <div style={{ position: "relative", width: "800px", height: "500px" }}>
        {/* Corporate Site Homepage */}
        <img
          src={crackd1}
          alt="Corporate Site Homepage"
          style={{
            position: "absolute",
            top: "0px",
            left: "0px",
            width: "350px",
            height: "auto",
            zIndex: 1,
          }}
        />

        {/* Webpage Mockup */}
        <img
          src={crackd2}
          alt="Webpage Mockup"
          style={{
            position: "absolute",
            top: "120px",
            left: "200px",
            width: "450px",
            height: "auto",
            zIndex: 2,
          }}
        />

        {/* Crackd Logo */}
        <img
          src={crackd3}
          alt="Crackd Logo"
          style={{
            position: "absolute",
            bottom: "0px",
            left: "0px",
            width: "200px",
            height: "auto",
            zIndex: 3,
          }}
        />
      </div>
    </div>
  );
}

export default function Home() {
  return (
    <div>
      <Tagline />

      <div
        style={{
          display: "flex",
          alignItems: "flex-start",
          gap: "2rem",
          marginTop: "4rem",
        }}
      >
        {/* Text takes up 60% */}
        <div style={{ flex: "0 0 60%" }}>
          <HumorProjectTextSection />
        </div>

        {/* Images take up 40% */}
        <div style={{ flex: "0 0 40%", display: "flex", justifyContent: "flex-end" }}>
          <HumorProjectImagesSection />
        </div>
      </div>
    </div>
  );
}
